import React from 'react';

const ToDoList = (props) => {
    console.log(props);
    return (
        <>
            <div className='todo_style'>
            <i className="fa fa-times"/> &nbsp;&nbsp;<li> {props.text}</li>
            </div>
                
        </>
    );
}

export default ToDoList;
